import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Rapidly Add Items to Cart ---
    const addToCartButtons = await page.locator('button.add-to-cart').all();
    if (addToCartButtons.length < 5) {
      throw new Error('Could not find enough "Add to Cart" buttons to perform the test.');
    }

    // Add 5 different items to the cart in quick succession
    for (let i = 0; i < 5; i++) {
      await addToCartButtons[i].click();
    }

    // Wait for the cart counter to update
    await page.waitForFunction(() => {
      const cartElement = document.querySelector('.cart');
      return cartElement && !cartElement.textContent.includes('0');
    });

    const cartCounterAfterAdd = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open and Manipulate Cart ---
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal', { state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Increase quantity of the first item
    const quantityButtons = await page.locator('#cartModal .quantity-btn:has-text("+")').all();
    await quantityButtons[0].click();
    await quantityButtons[0].click(); // Increase by 2

    // Remove the third item
    const removeButtons = await page.locator('#cartModal button.remove-item').all();
    await removeButtons[2].click();

    // Wait for the DOM to update after removal
    await page.waitForTimeout(500);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_manipulated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_manipulated.png'));
    const cartTotalAfterManipulation = await page.locator('#cartTotal').textContent();

    // --- Clear the Cart ---
    const remainingRemoveButtons = await page.locator('#cartModal button.remove-item').all();
    for (const button of remainingRemoveButtons) {
      await button.click();
    }

    // Wait for the empty cart message to appear
    await page.waitForSelector('div.empty-cart', { state: 'visible' });
    const emptyCartMessage = await page.locator('div.empty-cart').textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_cleared.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_cleared.png'));

    // Close the cart modal to check the main page counter
    await page.locator('#cartModal .close').first().click();
    await page.waitForSelector('#cartModal', { state: 'hidden' });
    const finalCartCounter = await page.locator('div.cart').textContent();


    return {
      success: true,
      action: "Successfully performed a rapid cart manipulation stress test: added 5 items, increased quantity, removed an item, and cleared the cart.",
      extractedData: {
        cartCounterAfterAdd: cartCounterAfterAdd.trim(),
        cartTotalAfterManipulation: `$${cartTotalAfterManipulation}`,
        emptyCartMessage: emptyCartMessage.trim(),
        finalCartCounter: finalCartCounter.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to complete the rapid cart manipulation stress test.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
